/* Iida Peltonen 2022 */

import Maa from './Maa'
import '.:/App.css'

const Maalista = ({ maa }) => {

  function HandleClick(maa) {
    console.log(maa)
    return (
      <div>
        <Maa key={maa.name.official} maa={maa} />
      </div>
    )
  }

  return (
    <div>
      <ul>
        <li key={maa.name.official}>
          {maa.name.official}
          <button onClick={() =>HandleClick(maa)}>
            Näytä
          </button>
          <Maa key={maa.name.official} maa={maa} class="piilossa" />
        </li>
      </ul>
    </div>
  )
}

export default Maalista
